import React from "react";
import { CONTACT_FORM } from '../../utils/consts';

const inputStyle = {
  position: "absolute",
  left: "-5000px"
};

const Contact = () => {

  return (

    <section className="newsletter_area">
      <div className="container">
        <div className="row justify-content-center align-items-center">
          <div className="col-lg-12">
            <div className="subscription_box text-center">
              <h2 className="text-uppercase text-white">FEEL FREE TO CONTACT ME</h2>
              <a className="primary_btn" href={CONTACT_FORM} target={"_blank"} rel="noopener noreferrer"><span>CONTACT</span></a>
            </div>
          </div>
        </div>
      </div>
    </section>

  )

}

export default Contact;
